import React, { ReactElement } from "react";
import styled from "styled-components/native";
import Tour from "./FM/Tour";

interface Props {}

export default function Home({}: Props): ReactElement {
  return (
    <Styled.container>
      <Tour
        index={0}
        title="Connection Stats"
        description="Stay updated with your friends circles"
      />
    </Styled.container>
  );
}

const Styled = {
  container: styled.View`
    flex: 1;
  `,
  heading: styled.Text``,
};
